import { FreeMode } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";

import LocationBar from "./components/LocationBar/LocationBar";
import Input from "../../shared/Input/Input";
import EventCardLG from "../../shared/EventCardLG/EventCardLG";
import EventCardSM from "../../shared/EventCardSM/EventCardSM";
import NavBar from "../../shared/NavBar/NavBar";

import search from "../../assets/images/icons/search.svg";
import eventImageOne from "../../assets/images/start-screen-img.png";
import eventImageTwo from "../../assets/images/placeholder-event-img-1.png";
import eventImageThree from "../../assets/images/placeholder-event-img-2.png";
import memberPlaceholderOne from "../../assets/images/profile-placeholder-1.png";
import memberPlaceholderTwo from "../../assets/images/profile-placeholder-2.png";
import memberPlaceholderThree from "../../assets/images/profile-placeholder-3.png";

const events = [
  {
    eventID: 1,
    eventName: "Cocktail party 'Goodbye Summer'",
    eventDescription:
      "Lorem ipsum dolor sit amet about Cocktail party 'Goodbye Summer'",
    eventDate: "2022-08-28",
    eventTime: "20:00",
    eventStart: "20:00",
    eventEnd: "00:00",
    eventLocation: "Chișinău, Moldova",
    eventImage: eventImageOne,
    peopleJoined: [
      {
        userID: 1,
        userPicture: memberPlaceholderOne,
      },
      {
        userID: 2,
        userPicture: memberPlaceholderTwo,
      },
      {
        userID: 3,
        userPicture: memberPlaceholderThree,
      },
      {
        userID: 4,
        userPicture: memberPlaceholderThree,
      },
      {
        userID: 5,
        userPicture: memberPlaceholderThree,
      },
      {
        userID: 6,
        userPicture: memberPlaceholderThree,
      },
    ],
  },
  {
    eventID: 2,
    eventName: "Bla Bla Bla Event for my friends",
    eventDescription:
      "Lorem ipsum dolor sit amet about Bla Bla Bla Event for my friends",
    eventDate: "2022-09-15",
    eventTime: "18:00",
    eventStart: "18:00",
    eventEnd: "23:00",
    eventLocation: "Chișinău, Moldova",
    eventImage: eventImageOne,
    peopleJoined: [
      {
        userID: 1,
        userPicture: memberPlaceholderOne,
      },
      {
        userID: 2,
        userPicture: memberPlaceholderTwo,
      },
      {
        userID: 3,
        userPicture: memberPlaceholderThree,
      },
      {
        userID: 4,
        userPicture: memberPlaceholderThree,
      },
    ],
  },
  {
    eventID: 3,
    eventName: "Bike ride around the town",
    eventDescription:
      "Lorem ipsum dolor sit amet about Bike ride around the town",
    eventDate: "2022-10-13",
    eventTime: "20:00",
    eventStart: "20:00",
    eventEnd: "00:00",
    eventLocation: "Chișinău, Moldova",
    eventImage: eventImageTwo,
    peopleJoined: [
      {
        userID: 1,
        userPicture: memberPlaceholderOne,
      },
      {
        userID: 2,
        userPicture: memberPlaceholderTwo,
      },
      {
        userID: 3,
        userPicture: memberPlaceholderThree,
      },
      {
        userID: 4,
        userPicture: memberPlaceholderThree,
      },
      {
        userID: 5,
        userPicture: memberPlaceholderThree,
      },
    ],
  },
  {
    eventID: 4,
    eventName: "Cyber Team for CS.GO tournament",
    eventDescription:
      "Lorem ipsum dolor sit amet about Cyber Team for CS.GO tournament",
    eventDate: "2022-12-21",
    eventTime: "20:00",
    eventStart: "20:00",
    eventEnd: "00:00",
    eventLocation: "Chișinău, Moldova",
    eventImage: eventImageThree,
  },
];

const Home = () => {
  const params = {
    slidesPerView: "auto",
    spaceBetween: 16,
    freeMode: true,
  };

  return (
    <div className="homepage">
      <LocationBar />
      <Input
        type="text"
        placeholder="Search for event"
        icon={search}
        iconType="button"
        mt="16"
        mb="16"
      />
      <Swiper {...params} className="events-slider" modules={[FreeMode]}>
        {!!events &&
          events.length > 0 &&
          events.map((item) => {
            const {
              eventID,
              eventName,
              eventDate,
              eventLocation,
              eventImage,
              eventDescription,
              peopleJoined,
              eventTime,
            } = item;
            return (
              <SwiperSlide key={eventID}>
                <EventCardLG
                  eventImage={eventImage}
                  eventDate={eventDate}
                  eventTime={eventTime}
                  eventTitle={eventName}
                  eventDescription={eventDescription}
                  eventLocation={eventLocation}
                  peopleJoined={peopleJoined}
                />
              </SwiperSlide>
            );
          })}
      </Swiper>
      <div className="upcoming-events">
        <div className="upcoming-events__title">
          <h5>Upcoming events</h5>
          <a href="/upcoming-events">View more</a>
        </div>
        {!!events &&
          events.length > 0 &&
          events.map((item) => {
            const {
              eventID,
              eventName,
              eventDate,
              eventLocation,
              eventImage,
              eventDescription,
              peopleJoined,
              eventTime,
            } = item;
            return (
              <EventCardSM
                key={eventID * 2}
                eventImage={eventImage}
                eventDate={eventDate}
                eventTime={eventTime}
                eventTitle={eventName}
                eventDescription={eventDescription}
                eventLocation={eventLocation}
                peopleJoined={peopleJoined}
              />
            );
          })}
      </div>
      <NavBar />
    </div>
  );
};

export default Home;
